import React from 'react';
import QRCode from 'qrcode.react';

import inputData from './inputData'

const QrCode = () => {
  return (
    <div>
      <inputData />
      <QRCode value="http://facebook.github.io/react/" />
    </div>
  )
}

export default QrCode
